// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awChipListRenderFunction } from 'js/AwChipListService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwChipListService', () => import('js/AwChipListService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awChipListRenderFunction",
            "deps": "js/AwChipListService"
        },
        "initialize": {
            "actionType": "JSFunction",
            "method": "initChipList",
            "inputData": {
                "prop": "{{props}}"
            },
            "deps": "js/AwChipListService"
        },
        "destroyEventSubscriptions": {
            "actionType": "JSFunction",
            "method": "destroyIndicatorSubscription",
            "inputData": {
                "data": "{{data.subscriptions}}"
            },
            "deps": "js/AwChipListService"
        }
    },
    "data": {
        "subscriptions": []
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "onMount": "initialize",
        "render": "render",
        "onUnmount": "destroyEventSubscriptions"
    },
    "props": {
        "dataprovider": {
            "type": "object"
        },
        "prop": {
            "type": "object"
        },
        "chip": {
            "type": "object"
        },
        "button-type": {
            "type": "string"
        },
        "action": {
            "type": "action"
        },
        "ui-icon-action": {
            "type": "action"
        }
    },
    "_viewModelId": "AwChipList",
    "_uniqueViewModelId": "AwChipList",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awChipListRenderFunction, undefined, ctxImportObj );

export default Component;
